import react,{Component} from 'react'
export default class AppDisplay extends Component{
    constructor(props)
    {
        super(props);
        this.state={
                'fname':'Poonam',
                'lname':'Chauhan'
        }
    }
    render(){
        return(
            <p>{this.state.fname} {this.state.lname}</p>
        );
    }
}
